System.out.println("发布订单");
DddOrder.PublishOrderCmd cmd = CommonHelper.copy(publishOrderDto, DddOrder.PublishOrderCmd.class);
gatewayBus.send(cmd);

System.out.println("创建订单");
DddOrder.CreateOrderCmd cmd = CommonHelper.copy(createOrderDto, DddOrder.CreateOrderCmd.class);
gatewayBus.send(cmd);

log.info("收到{创建账户}命令,cmd={}",toJson(cmd));
 AccountCreatedEvt evt=new AccountCreatedEvt(getId(),genAccountNO(),cmd.getUserId());
 this.create(evt.getUserId(),evt.getAccountNo(),evt.getBalance());
 repository.save(this);
 log.info("{账户创建}执行成功.agg={}",toJson(this));

log.info("收到{账户充值}命令,cmd={}",toJson(cmd));
 AccountCreditedEvt evt=copy(cmd,AccountCreditedEvt.class);
 this.credit(evt.getAmount());
 repository.save(this);
 log.info("{账户充值}执行成功.agg={}",toJson(this));
 AccountUtils.addLog(this.getId(),evt.getBankCreditId(),"执行{账户充值}操作成功，变动金额：+" + evt.getAmount(),evt);

log.info("收到{扣减转出账户金额}命令,cmd={}",toJson(cmd));
